    geo_json_8d528ca8491f62a36ef50b15d9bb7335.bindTooltip(
    function(layer){
    let div = L.DomUtil.create('div');
    
    let handleObject = feature=>typeof(feature)=='object' ? JSON.stringify(feature) : feature;
    let fields = ["Hval", "x", "y", "Pval", "3d_dens", "cluster"];
    let aliases = ["Hval", "x", "y", "Pval", "3d_dens", "cluster"];
    let table = '<table>' +
        String(
        fields.map(
        (v,i)=>
        `<tr>
            <th>${aliases[i]}</th>
            
            <td>${handleObject(layer.feature.properties[v])}</td>
        </tr>`).join(''))
    +'</table>';
    div.innerHTML=table;
    
    return div
    }
